import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>My React App</h1>
      </header>
      <img
        style={{
          width: "100%",
          height: "100%",
          borderRadius: 20,
          border: "1px black solid",
        }}
      />
    </div>
  );
}

export default App;
